import { useState, useEffect } from "react";
import Activity from "../components/Activity";
import Performence from "../components/Performence";
// import useFetch from "../service/service";
import axios from "axios";



function Dashboard(id) {
  // console.log(id);
  // // const {user, loading, error} = useFetch(`http://localhost:3000/user/${id}`)
  // const {user} = useFetch(`http://localhost:3000/user/12`)

  // if(loading) return <h1>LOADING ...</h1>
  // if(error) console.log(error);

  // ------------
  const [user, setUser] = useState(null)

  useEffect(() => {
    axios.get(`http://localhost:3000/user/12`)
    .then((response) => {
      setUser(response.data)
    })
  }, [id])
  // ---------------------------

  return (
    <div>
      <h1>USER</h1>
      <p>{user?.data.id}</p>
      <Activity />
      <Performence />
    </div>
  );
}

export default Dashboard;
